'use strict';
import { StyleSheet } from 'react-native';

module.exports = StyleSheet.create({
    title1:{
        fontSize:25,
        fontFamily:"Larsseit Bold"
    },
    title2:{
        fontSize:18,
        fontFamily:"Aktiv Bold"
    },
    regularText:{
        fontSize:16,
        fontFamily:"Aktiv Regular"
    },
    regularTextBold:{
        fontSize:16,
        fontFamily:"Aktiv Bold"
    },
    errorText:{
        fontSize:16,
        fontFamily:"Aktiv Regular",
        color:"red"
    }
});
